import Vue from 'vue';
import App from "./App.vue";
import axios from 'axios';
import router from "./router";
import store from "./store";
axios.defaults.baseURL = 'https://proyectofinal-8e02a.firebaseio.com/'; //axios.defaults.headers.common['Authorization'] = 'Prueba'

axios.defaults.headers.get['Accepts'] = 'application/json';
var reqInterceptor = axios.interceptors.request.use(function (config) {
  console.log('Request Interceptor', config);
  return config;
});
var resInterceptor = axios.interceptors.response.use(function (res) {
  console.log('Response Interceptor', res);
  return res;
});
axios.interceptors.request.eject(reqInterceptor);
axios.interceptors.response.eject(resInterceptor);
new Vue({
  el: '#app',
  router: router,
  store: store,
  render: function render(h) {
    return h(App);
  }
});
